import React from "react";

const BackGroundVideo = (state) => {
const {videoSrc} = state
  return (
    <div>
      <video className="videoTag" autoPlay="autoplay" loop="loop" muted>
        <source src = {videoSrc} type="video/mp4" />
      </video>
    </div>
  );
};
export default BackGroundVideo;
